Ext.data.JsonP['Titanium_SDK_6.2.1.GA_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Titanium SDK 6.2.1.GA - 19 September 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-51250829\" class=\"content\">\n                        <h1>Titanium SDK 6.2.1.GA - 19 September 2017</h1>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_6.2.1.GA_Release_Note-section-src-51250829_TitaniumSDK6.2.1.GAReleaseNote-TitaniumSDK6.2.1.GA-19September2017\">Titanium SDK 6.2.1.GA - 19 September 2017</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_6.2.1.GA_Release_Note-section-src-51250829_TitaniumSDK6.2.1.GAReleaseNote-Aboutthisrelease\">About this release</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_6.2.1.GA_Release_Note-section-src-51250829_TitaniumSDK6.2.1.GAReleaseNote-Fixedissues\">Fixed issues</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Titanium_SDK_6.2.1.GA_Release_Note-section-src-51250829_TitaniumSDK6.2.1.GAReleaseNote-APIchanges\">API changes</a>    </p>\n</li></ul></li></ul>    <div class=\"section section-2 \" id=\"src-51250829_TitaniumSDK6.2.1.GAReleaseNote-Aboutthisrelease\">\n        <h2 class=\"heading \"><span>About this release</span></h2>\n    <p>Titanium SDK 6.2.1.GA is a patch release of the SDK, addressing high-priority issues from previous releases.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-51250829_TitaniumSDK6.2.1.GAReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-25210\" target=\"_blank\">TIMOB-25210</a> - iOS: Cannot submit builds with iOS 11 / Xcode 9 due to missing &quot;Marketing Image&quot;    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-25285\" target=\"_blank\">TIMOB-25285</a> - iOS: Error out on duplicate third-party frameworks    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-25320\" target=\"_blank\">TIMOB-25320</a> - iOS: CLI errors incorrectly when xcode eula not accepted    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-51250829_TitaniumSDK6.2.1.GAReleaseNote-APIchanges\">\n        <h2 class=\"heading \"><span>API changes</span></h2>\n    <p>There were no changes to the API for this release.    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=51250829\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Titanium SDK 6.2.1.GA Release Note"});